/**
 * Created by abhiram on 7/1/20.
 */

import React, {Component} from 'react';
import Utils from '../../Utils/Util';
import {Link} from "react-router-dom";
import LogoutComponent from "../Login/LogoutComponent";
import Navbar from 'react-bootstrap/Navbar'

class MenuComponent extends Component {
    constructor(props) {
        super(props);
        this.permissions = JSON.parse(Utils.getItemLocalStorage('menu_permission'));
        this.permissionArray = Object.keys(this.permissions).map(i => this.permissions[i]);
    }

    render() {
        return (
            <div className="header">
                <Link to="/dashboard" className="logo">FreshTrak</Link>
                <LogoutComponent/>
                <div className="list-group">
                    {/*<ul>
                        { this.permissionArray.map((value, index) => {
                            return (
                                <div className="list-item menuList" key={index}>
                                    <ul><u>{value[0].menu_name}</u>
                                        {
                                            value.map((valueInner, indexInner) => {
                                                return (
                                                    <li className="sub-menu" key={indexInner}><Link
                                                        to={valueInner.menu_link}>{valueInner.sub_menu_name}</Link></li>

                                                )
                                            })
                                        }
                                    </ul>
                                </div>
                            )
                        })}
                    </ul>*/}
                    <Navbar bg="light" expand="lg">
                        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="mr-auto">
                                <Nav.Link href="#home">Home</Nav.Link>
                                <Nav.Link href="#link">Link</Nav.Link>
                                <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                                    <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                                    <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                                    <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                                    <NavDropdown.Divider />
                                    <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                                </NavDropdown>
                            </Nav>
                            <Form inline>
                                <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                                <Button variant="outline-success">Search</Button>
                            </Form>
                        </Navbar.Collapse>
                    </Navbar>
                </div>
            </div>
        )
    }
}
export default MenuComponent;
